// src/pages/AdminDashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './AdminDashboard.css';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
  const [mobiles, setMobiles] = useState([]);
  const [form, setForm] = useState({
    brand: '', model: '', ram: '', storage: '', price: '', condition: ''
  });
  const [image, setImage] = useState(null);
  const navigate = useNavigate();
  const token = localStorage.getItem('token');

  // Redirect if not logged in
  useEffect(() => {
    if (!token) {
      navigate('/login');
      return;
    }
    fetchMobiles();
  }, [token, navigate]);

  // Fetch all mobiles
  const fetchMobiles = async () => {
    try {
      const res = await axios.get('/api/mobiles', {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMobiles(res.data);
    } catch (err) {
      console.error('‚ùå Error fetching mobiles:', err);
    }
  };

  // Handle form field changes
  const handleInputChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  // Upload new mobile
  const handleUpload = async (e) => {
    e.preventDefault();
    const data = new FormData();
    Object.entries(form).forEach(([key, value]) => data.append(key, value));
    data.append('image', image);

    try {
      await axios.post('/api/mobiles/upload', data, {
        headers: {
          'Content-Type': 'multipart/form-data',
          Authorization: `Bearer ${token}`
        }
      });
      alert('‚úÖ Mobile uploaded!');
      setForm({ brand: '', model: '', ram: '', storage: '', price: '', condition: '' });
      setImage(null);
      fetchMobiles();
    } catch (err) {
      console.error('‚ùå Upload failed:', err);
      alert('Upload failed');
    }
  };

  // Delete mobile entry
  const handleDelete = async (id) => {
    if (!window.confirm('Delete this mobile?')) return;
    try {
      await axios.delete(`/api/mobiles/${id}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMobiles((prev) => prev.filter((m) => m._id !== id));
    } catch (err) {
      console.error('‚ùå Delete failed:', err);
      alert('Delete failed');
    }
  };

  return (
    <div className="admin-dashboard">
      <h1>üì± Admin Dashboard</h1>

      <form className="upload-form" onSubmit={handleUpload}>
        <h2>üì§ Upload New Mobile</h2>
        <input name="brand" type="text" placeholder="Brand" value={form.brand} onChange={handleInputChange} required />
        <input name="model" type="text" placeholder="Model" value={form.model} onChange={handleInputChange} required />
        <input name="ram" type="text" placeholder="RAM (e.g. 4GB)" value={form.ram} onChange={handleInputChange} required />
        <input name="storage" type="text" placeholder="Storage (e.g. 64GB)" value={form.storage} onChange={handleInputChange} required />
        <input name="price" type="number" placeholder="Price (‚Çπ)" value={form.price} onChange={handleInputChange} required />
        <input name="condition" type="text" placeholder="Condition (e.g. Good)" value={form.condition} onChange={handleInputChange} required />
        <input type="file" onChange={(e) => setImage(e.target.files[0])} required />
        <button type="submit">Upload</button>
      </form>

      <div className="mobile-list">
        <h2>üì¶ Uploaded Mobiles</h2>
        {mobiles.length === 0 ? (
          <p>No mobiles uploaded yet.</p>
        ) : (
          <div className="mobile-grid">
            {mobiles.map((mobile) => (
              <div key={mobile._id} className="mobile-card">
                <img src={mobile.imageUrl} alt={mobile.model} />
                <div>
                  <h3>{mobile.brand} - {mobile.model}</h3>
                  <p>{mobile.ram} / {mobile.storage}</p>
                  <p>{mobile.condition} - ‚Çπ{mobile.price}</p>
                  <button onClick={() => handleDelete(mobile._id)}>üóëÔ∏è Delete</button>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default AdminDashboard;
